import React from "react";
import {Box} from "@mui/material";
import {BrowserRouter as Router, Link} from "react-router-dom";

function App() {
  return (
    <QueryClientProvider client={queryClient}>
      <Box p={4}>
        <Router>
          <ul>
            <li>
              <Link to="/nation">Nation</Link>
            </li>
            <li>
              <Link to="/states">States</Link>
            </li>
          </ul>
        </Router>
      </Box>
    </QueryClientProvider>
  );
}

export default App;
